%[text] ## OLRippleTest
mdl = "OLRippleTest" %[output:3ae32648]
load_system(mdl);
simIn = Simulink.SimulationInput(mdl);
load("Data\OLRippleTestOP.mat");
simIn = setInitialState(simIn, OLRippleTestOP);
simIn = setModelParameter(simIn,"StopTime","1.0001");
out = sim(simIn);
close_system(mdl, 0);
%%
figure; %[output:0a07d1f4]
tiledlayout('vertical'); %[output:0a07d1f4]
idx = out.u.Time > 1;

nexttile; %[output:0a07d1f4]
hold on; %[output:0a07d1f4]
plot(out.u.Time(idx)-1, out.u.Data(idx, 1)); %[output:0a07d1f4]
plot(out.u.Time(idx)-1, out.u.Data(idx, 2)); %[output:0a07d1f4]
ylabel('u'); %[output:0a07d1f4]
grid on %[output:0a07d1f4]
axis padded %[output:0a07d1f4]
hold off; %[output:0a07d1f4]

nexttile; %[output:0a07d1f4]
hold on; %[output:0a07d1f4]
plot(out.V.Time(idx)-1, out.V.Data(idx, 1)); %[output:0a07d1f4]
plot(out.V.Time(idx)-1, out.V.Data(idx, 2)); %[output:0a07d1f4]
ylabel('Vo (V)'); %[output:0a07d1f4]
axis padded %[output:0a07d1f4]
hold off; %[output:0a07d1f4]

nexttile; %[output:0a07d1f4]
hold on; %[output:0a07d1f4]
plot(out.I.Time(idx)-1, out.I.Data(idx, 1)); %[output:0a07d1f4]
plot(out.I.Time(idx)-1, out.I.Data(idx, 2)); %[output:0a07d1f4]
ylabel('Io (A)'); %[output:0a07d1f4]
xlabel('Time (s), from t=1') %[output:0a07d1f4]
axis padded %[output:0a07d1f4]
hold off; %[output:0a07d1f4]

ExportPlot('OLRippleTest'); %[output:0a07d1f4]
