%[text] ## Gràfics Soroll Masses
% DS columnes - Consigna, Vermell, Groc, Error teòric
% Configuració Dades
titol = 'LlacObertVelocitatPP';
Datapoints = Data_LlacObertVelocitat_GMassaMotor_VRealimentacio;
consigna = Datapoints(:,1);
vermell = Datapoints(:,2);
groc = Datapoints(:,3);

% Configuració Eixos
Tmin = 10;
Tmax = 20;
Ymin = -1;
Ymax = 2.5;

% Configuració Línia Auxiliar
PrintLine = true;
LineXmin = 10;
LineXmax = 15;
YlineVal = mean(groc((11/0.005):(15/0.005)));
PrintLabel = true;
StringLabel = sprintf('%.4f V', YlineVal);

% Configuració Línia Auxiliar2
PrintLine2 = true;
LineXmin2 = 10;
LineXmax2 = 15;
YlineVal2 = 0;
PrintLabel2 = true;
StringLabel2 = sprintf('%.0f V', YlineVal2);

% Còmput i 
xpoints = 0.005*(1:size(Datapoints,1));
figure(); %[output:476d5acc]
hold on; %[output:476d5acc]
grid on; %[output:476d5acc]

plot(xpoints, consigna, 'Color', '#77AC30'); %[output:476d5acc]
plot(xpoints, vermell, 'Color', '#A2142F'); %[output:476d5acc]
plot(xpoints, groc, 'Color', '#EDB120'); %[output:476d5acc]

if PrintLine
    %yline(YlineVal, '--', 'Color', '#0072BD');
    plot([LineXmin LineXmax], YlineVal*[1 1], '--', 'Color', '#0072BD'); %[output:476d5acc]
    if PrintLabel
        text(mean([LineXmin, LineXmax])-0.5, YlineVal+0.2, StringLabel, 'Color', '#0072BD'); %[output:476d5acc]
    end
end
if PrintLine2
    %yline(YlineVal, '--', 'Color', '#0072BD');
    plot([LineXmin2 LineXmax2], YlineVal2*[1 1], '--', 'Color', 'black'); %[output:476d5acc]
    if PrintLabel2
        text(mean([LineXmin2, LineXmax2])-0.2, YlineVal2-0.2, StringLabel2, 'Color', 'black'); %[output:476d5acc]
    end
end

ylabel('[V]'); %[output:476d5acc]
xlabel('Temps [s]'); %[output:476d5acc]
axis([Tmin Tmax Ymin Ymax]); %[output:476d5acc]
xticks(Tmin:Tmax); %[output:476d5acc]
legend(["Consigna", "Vtac", "Massa del motor"]); %[output:476d5acc]
set(gcf,'units','pixels','position',[0,0,576,384/1.25]); %[output:476d5acc]
