%[text] ## Gràfics Càlcul Constants de Temps
% DS columnes - Consigna, Vermell, Groc, Error teòric
% Configuració Dades
titol = 'CalculTau';
Datapoints = Data_LlacObertVelocitat_GMassaMotor_VRealimentacio;
consigna = Datapoints(:,1);
vermell = Datapoints(:,2);
groc = Datapoints(:,3);

% Configuració Eixos
Tmin = 10;
Tmax = 15;
Ymin = 0;
Ymax = 2.5;

% Configuració Línia Auxiliar
YlineVal = mean(vermell((12/0.005):(15/0.005))) %[output:04d2e75f]
StringLabel = sprintf('Vf = %.4f V', YlineVal);

% Còmput i 
xpoints = 0.005*(1:size(Datapoints,1));
figure(); %[output:6062338a]
hold on; %[output:6062338a]
grid on; %[output:6062338a]

plot(xpoints, consigna, 'Color', '#77AC30'); %[output:6062338a]
plot(xpoints, vermell, 'Color', '#A2142F'); %[output:6062338a]
%plot(xpoints, groc, 'Color', '#EDB120');

yline(YlineVal, '--', 'Color', '#0072BD', 'LineWidth', 2); %[output:6062338a]
text(mean([LineXmin, LineXmax])-0.5, YlineVal+0.18, StringLabel, 'Color', '#0072BD'); %[output:6062338a]

xpointsp = xpoints((Tmin/0.005):(Tmax/0.005));
p = polyfit(xpointsp, vermell((Tmin/0.005):(Tmax/0.005)), 6);
%vermell2 = polyval(p,xpointsp);
%plot(xpointsp, vermell2); % Veure la regressió polinòmica

YlineVal63 = 0.63*YlineVal;
p63 = p;
p63(end) = p63(end) - YlineVal63;
r63 = roots(p63);
r63 = r63(0 == imag(r63)); % Descartem imaginaris
x63 = r63(r63 < 12); % Ens quedem amb la solucio del règim transitori
yline(YlineVal63, '--', 'Color', '#D95319'); %[output:6062338a]
text(11.5, YlineVal63+0.1, '63% Vf', 'Color', '#D95319'); %[output:6062338a]
plot(x63*[1 1], [YlineVal63 0], '*-', 'Color', '#D95319'); %[output:6062338a]
text(x63+0.07, YlineVal63-0.6, sprintf('t 63%% = %.4f s', (x63-Tmin)), 'Color', '#D95319'); %[output:6062338a]

YlineVal95 = 0.95*YlineVal;
p95 = p;
p95(end) = p95(end) - YlineVal95;
r95 = roots(p95);
r95 = r95(0 == imag(r95)); % Descartem imaginaris
x95 = r95(r95 < 12); % Ens quedem amb la solucio del règim transitori
yline(YlineVal95, '--', 'Color', '#7E2F8E'); %[output:6062338a]
text(12, YlineVal95-0.1, '95% Vf', 'Color', '#7E2F8E'); %[output:6062338a]
plot(x95*[1 1], [YlineVal95 0], '*-', 'Color', '#7E2F8E'); %[output:6062338a]
text(x95+0.05, YlineVal95-0.7, sprintf('t 95%% = %.4f s', (x95-Tmin)), 'Color', '#7E2F8E'); %[output:6062338a]

ylabel('[V]'); %[output:6062338a]
xlabel('Temps [s]'); %[output:6062338a]
axis([Tmin Tmax Ymin Ymax]); %[output:6062338a]
xticks(Tmin:Tmax); %[output:6062338a]
legend(["Consigna", "Vtac"]); %[output:6062338a]
%legend("Position",[0.6,0.2,0.3,0.15])
